		'ocpa' : '',
		'description' : '<p>Curtis serves as Vice-President of Cors & Bassett. He has a multi-faceted practice so that he can handle his clients\' diverse needs with efficiency and expertise. Curtis primarily practices in the labor/employment area and, in fact, in 2013, Curtis was voted by attorneys throughout Ohio as one of the Top 50 attorneys in Cincinnati and one of the top 100 attorneys in Ohio in the labor and employment area.  In 2014 and 2015, Curtis was again voted as one of the Top 50 labor and employment attorneys in Cincinnati, and in 2016 and 2017, he was voted as one of the Top 50 Lawyers in Cincinnati.  He has also received an AV rating from his peers - the highest rating an attorney can receive.</p><p>In the labor/employment arena, Curtis regularly counsels clients on a host of issues including:</p><table><tr><td><ul><li>Drafting employee handbooks</li><li>Negotiating severance agreements</li><li>Non-competition and trade secret issues</li><li>Employee leave issues and compliance with Title VII</li><li>Americans with Disabilities Act</li><li>Family and Medical Leave Act</li></ul></td><td><ul><li>Age Discrimination in Employment Act</li><li>Fair Labor Standards Act</li><li>Staying union-free</li><li>General management-union issues</li><li>Negotiation of collective bargaining agreements</li><li>Election campaigns opposing union organizational attempts</li></ul></td><tr></table><p>Curtis has also successfully represented management clients in labor arbitrations, in unfair labor practice proceedings before the National Labor Relations Board, and he regularly practices before a host of other governmental agencies including the:</p><table><tr><td>Equal Opportunity Commission</td><td>Ohio Civil Rights Commission</td><td>Kentucky Human Relations Commission</td></tr><tr><td>Pennsylvania Civil Rights Commission</td><td>U.S. Department of Labor</td><td>United States Occupational Safety and Health Administration</td></tr></table><p>He has also successfully tried a number of employment-related cases in federal and state courts in Ohio, Kentucky, Indiana, Pennsylvania, and California.</p><p>Curtis also represents one of the largest automobile dealers in the Greater Cincinnati area (The Kenwood Dealer Group) and has developed an expertise in the automotive industry.  In fact, in 2012, Curtis testified as an expert witness in front of an Ohio Senate Subcommittee regarding an amendment to Ohio\'s Consumer Sales Practices Act and also assisted in drafting the language of that amendment.  Curtis also represents one of the largest manufacturers of trailers in the United States and has tried cases in the commercial litigation arena throughout the United States.  Indeed, Curtis has achieved results in three separate proceedings which resulted in multi-million dollar recoveries for his clients.</p><p>In addition to non-competition and trade secret cases, Curtis has litigated trademark cases both in federal court and before the United States Patent and Trademark Board.</p><p>Curtis is also a regular speaker on labor and employment issues, as well as litigation topics in general.</p><p>Curtis received his juris doctor from the University of Cincinnati, where he served as an Editor on the University of Cincinnati Law Review. He earned a Masters of Music degree from the University of Cincinnati College-Conservatory of Music and a Bachelor of Music degree from the University of Alabama, where he graduated cum laude.</p><p>Curtis is an avid runner, having completed 18 marathons, including the Boston Marathon 4 times. Curtis also enjoys playing tennis and listening to classical music, as he is a former classical trumpet player, having earned a Master\'s of Music degree in trumpet performance from the University of Cincinnati College-Conservatory of Music.</p><div class="badges"><div class="badge">'+badges.ccornett.super_lawyers.lg+'</div><div class="badge">'+badges.ccornett.super_lawyers.milestone+'</div><div class="badge">'+badges.ccornett.super_lawyers.topFifty+'</div><div class="badge">'+badges.ccornett.super_lawyers.topHundred+'</div></div>',
