		'representative_matters' : '<p>My practice is focused primarily in the areas of labor and employment, litigation, transportation, and intellectual property issues, such as:</p><p><strong>Labor & Employment</strong></p><ul><li>I represent employers in all aspects of employment/labor law including: Title VII compliance, FMLA and other leave issues, discharge and discipline matters, trade secret and non-competition matters, overtime and other wage issues, and union/collective bargaining issues.</li><li>I further represent employers in litigation regarding all of the above employment/labor issues in federal and state court, private arbitrations, before the Equal Employment Opportunity Commission, the Ohio Civil Rights Commission, the National Labor Relations Board, and before the Department of Labor.</li></ul><p><strong>Automobile Dealerships</strong><p><ul><li>I assist automobile dealers with a wide range of legal matters including:  disputes with consumers; compliance with federal and state laws and regulations; and disputes with manufacturers.  In 2012, I testified in front of an Ohio Senate Subcommittee regarding an amendment to the Consumer Sales Practices Act and I also assisted in drafting the language of the amendment.</li></ul><p><strong>Commercial Litigation</strong></p><li>I represent our clients in a wide range of business disputes including contractual disputes, trademark enforcement, shareholder disputes, construction and real estate disputes, and transportation-related matters.</li><p><strong>Case Studies</strong></p><p>Decisions of note in which I have served as lead counsel include:</p><ul><li>Whitten v. Kenwood Dealer Group, Inc., Case No. A9806163 (Hamilton Cty. C.P. 2000) (Jury verdict in favor of defendants/clients after three day jury trial regarding shareholder dispute);</li><li>Saturn of Kings Automall, Inc. v. Mike Albert Leasing, Inc., 92 Ohio St. 3d 513 (2001) (Successfully represented client in the seminal case in Ohio on Ohio\'s Certificate of Title Act, deciding that the Certificate of Title Act  trumps the Uniform Commercial Code in disputes over ownership of a motor vehicle);</li><li>France v. General Motors Corp., et al., Case No. A0007362 (Hamilton Cty. C.P. 2005) (Jury awarded $0 to plaintiff in consumer action against dealership after three day jury trial);</li><li>Booker v. Dee Sign Company, 2008 U.S. Dist. LEXIS 24035 (S.D. OH 2006), (Summary judgment entered in favor of employer in race discrimination case);</li><li>Kings Jeep, Inc. v. Daimler Chrysler Motor Co., LLC, Case No. A0609274 (Hamilton Cty. C.P. 2008) (Summary judgment entered in favor of dealership against manufacturer relating to sales incentive plans);</li><li>Hansen v. Zwanenberg Food Group (USA), Inc., 2010 U.S. Dist. LEXIS 72192 (S.D. OH 2010) (Summary judgment entered in favor of employer in case brought for overtime pay under the Fair Labor Standards Act);</li><li>Hereford v. The Greens of Madison Apartments, LLC, Case No. 39C011206 MF 524 (Jefferson Cty. Cir. Ct. 2014) (Obtained set-off award of over $600,000 for client/purchaser of real property due to seller\'s fraudulent conduct following two day bench trial).</li></ul>',
