		'role' : 'Member',
		'ocpa' : '',
		'description' : '<p>I serve as Vice-President of Cors & Bassett. I focus my practice on business law, concentrating on small to mid-size companies. I represent the firm\'s clients in commercial and general litigation, and also offer guidance and practical knowledge to business owners and managers in all aspects of business information, management, contracts, e-commerce, mergers and acquisitions, anti-trust, manufacturing and distribution, personal law and employment matters. I have been voted a Super Lawyer by other attorneys in Ohio every year since 2012.</p><p>I am a native of Cincinnati, and was admitted to practice law in 1992, after receiving a Bachelor of Arts and Juris Doctor from the University of Cincinnati.</p><div class="badges"><div class="badge">'+badges.kfeazell.super_lawyers.lg+'</div></div>',
