		'description' : '<p>Steve serves as the President of Cors & Bassett and is a member of its Executive Committee. His practice is generally concentrated in the representation of family- and privately-owned business clients. Specific practice areas include essentially all major areas of law related to the operation of a business, including general corporate and business law, real estate, financing arrangements, commercial transactions, acquisitions, labor and employment law, workers\' compensation, succession planning, regulatory matters and all areas of transportation law. He has also served as an arbitrator in connection with the resolution of family owned business disputes.  Steve received his B.A. from Transylvania University in 1979, where he majored in Business Administration and Economics, and received his Juris Doctor from the University of Kentucky in 1982.</p><p>For the years 2011, 2012, 2013, 2014, 2015, 2016, and 2017, Ohio Super Lawyer Magazine has named Steve as an Ohio Super lawyer in the areas of business law and transportation law. In addition, Cincy Business Magazine has identified Steve as one of Cincinnati\'s leading lawyers in the area of general business law for the years 2007 through 2017.</p><p>Steve is admitted to practice in Ohio and before the United States District Court for the Southern District of Ohio. Steve is a member of the Cincinnati Bar Association, the Ohio State Bar Association as well as several industry groups, including the International Council of Shopping Centers, the Transportation Lawyers Association, the Ohio Trucking Association, the Kentucky Motor Transport Association and the American Truck Historical Society.  Steve also serves as a member of the Board of Advisors for the University of Cincinnati Goering Center for Family and Private Businesses.</p><p>During the period from 1987 through 1991, Steve served as Vice President-Associate General Counsel for the O.K. Trucking Company, a regional common/contract carrier formerly based in Cincinnati, Ohio. While with the O.K. Trucking Co., Steve served as a member of the national negotiation team for Regional Carriers, Inc., in connection with the negotiation of the International Brotherhood of Teamsters National Master Freight Agreement.</p><p>Steve has contributed articles to various business and trade publications in the areas of general corporate law, entity selection, transportation law, workers compensation, and real estate law. Some of the publications in which his articles have appeared are Broker and Agent Real Estate Professionals Magazine, the Kentucky Motor Transport Association Trucker Magazine, the Ohio Trucking Association monthly newsletter, The Transportation Lawyer Journal and as a part of papers delivered at the annual meeting of the Transportation Lawyers Association.  He is also co-author of the article entitled “Jimmy Hoffa’s Vision:  The Rise and Fall of the Teamsters National Master Freight Agreement,” a history of the primary labor agreement between the Teamsters Union and the motor carrier industry.</p><p>In addition to his law practice, Steve volunteers his time as Counsel for the American Classical Music Hall of Fame, the Terrace Park Ohio Historical Society, and as a member of the Terrace Park Ohio Board of Zoning Appeals. He is also a former member of the Village Council for the Village of Terrace Park, the Board of Trustees for the World Piano Competition, the Cincinnati Fire Museum, and the Board of Trustees for the Cincinnati Playhouse in the Park.</p><div class="badges"><div class="badge">'+badges.sholmes.super_lawyers.lg+'</div><div class="badge">'+badges.sholmes.milestone.lg+'</div></div>',
